<span class="line"><span style="color:#FFCB6B;">seq</span><span style="color:#EEFFFF;"> </span><span style="color:#F78C6C;">1</span><span style="color:#EEFFFF;"> </span><span style="color:#F78C6C;">3</span><span style="color:#EEFFFF;"> </span><span style="color:#89DDFF;">|</span><span style="color:#FFCB6B;">tac</span></span>
